s.";i:2;s:121:"Incorrect adjustment of garage door travel limits will interfere with the proper operation of the safety reversal system.";i:3;s:117:"If your garage door opens ok but wont close then its possible the safety reversing sensors are not correctly aligned.";i:4;s:67:"Dont just assume that if the path is clear that the sensors are ok.";i:5;s:42:"This problem bugged me for several months.";i:6;s:75:"Hopefully after you read this you wont have the same problem in the future.";i:7;s:130:"If your door does not open all the way you may need to make an adjustment either to the door or to your travel and force settings.";i:8;s:69:"Your Security 20 garage door opener has self-diagnostic capabilities.";i:9;s:112:"On a Security 20 garage door opener the up arrow will flash 4 times followed by the down arrow flashing 2 times.";i:10;s:75:"This indicates that an obstruction binding or a sticking door was detected.";i:11;s:24:"Garage door not closing.";i:12;s:95:"Easy fixSafety sensors are the number one component that will cause a garage door not to close.";i:13;s:33:"Do you hear 10 clicks or the lig.";i:14;s:64:"LiftMaster garage door openers are designed to stop if they sen.";i:15;s:92:"This video demonstrates what to do if your wall-mounted garage door opener wont fully close.";i:16;s:148:"When you see your garage door opener lights flashing and the garage door will not close it could be the safety reversing sensors or the LOCK button.";i:17;s:76:"If there is a safety reversing sensor issue the main light s flash 10 times.";i:18;s:39:"Start with aligning the safety sensors.";i:19;s:14:"Answer 1 of 2.";i:20;s:90:"If the lights on the opener are flashing check to see that the safety sensors are aligned.";i:21;s:186:"Otherwise you will need to adjust the force if you have an older opener the force controls will be 2 adjustment screws on the end panel if its a newer electronic one press the yellow bu.";i:22;s:57:"Also Why does my garage door not close and light flashes.";i:23;s:99:"The blinking opener lights indicate that the safety sensors are likely blocked or out of alignment.";i:24;s:107:"The safety sensors use an invisible beam of infrared light to detect obstructions in the garage doors path.";i:25;s:118:"In some cases faulty springs or incorrect balance inhibit your LiftMaster from opening the garage door all of the way.";i:26;s:76:"The garage door seal always sits on the floor when the door is fully closed.";i:27;s:75:"This can easily get frozen and prevent your Liftmaster opener from working.";i:28;s:77:"If it is frozen you need to melt the ice before you attempt to open it again.";i:29;s:70:"Your garage doors logic board is the brain of your garage door opener.";i:30;s:64:"This brain can wear out in time so you could need a replacement.";i:31;s:115:"When the logic board wears out it can cause your garage door to close then open and vice versa without explanation.";i:32;s:28:"Get Logic Board Replacement.";i:33;s:106:"If the garage door sensors are detecting any objects or debris your garage door will not close completely.";i:34;s:66:"Inspect your garage entrance and floor for any potential culprits.";i:35;s:112:"If you determine that the sensors are not blocked you could be dealing with faulty or misaligned safety sensors.";i:36;s:124:"When my Liftmaster 1000 sdr opener would not close when using my remotes I replaced the capacitor and it solved the problem.";i:37;s:145:"However while reattaching the circuit board to the plastic case the plastic was so brittle that it snapped and would not hold the board in place.";i:38;s:78:"Sometimes there could be a box or a garbage can sitting too close to the eyes.";i:39;s:73:"Other times it may be a leaf hanging from the bottom of your garage door.";i:40;s:141:"Look at the photo eyes themselves if there are cobwebs or if there is dust on the lenses the eyes will sense this and cause the door reverse.";i:41;s:153:"Use the control on the wall and hold the button to close the door do not let go until it closes all the way If this closes then its a sensor problem you.";i:42;s:94:"The most common cause for your door not closing in the morning but will close at night is the.";i:43;s:68:"These sensors prevent the door from closing if the sensor beam gets.";i:44;s:83:"This safety feature is required on garage doors and keeps the door from closing on.";i:45;s:30:"The door opens but wont close.";i:46;s:52:"Check cable tension monitor see Installation Step 4.";i:47;s:97:"If the garage door opener lights blink check the safety reversing sensor see Installation Step 9.";i:48;s:95:"If the garage door opener lights dont blink and it is a new installation see Adjustment Step 2.";i:49;s:39:"For an existing installation see below.";}}